import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { fetchOrders } from '../../features/orders/ordersSlice';

const OrderList = () => {
  const dispatch = useDispatch();
  const orders = useSelector((state) => state.orders.list);
  
  useEffect(() => {
    dispatch(fetchOrders());
  }, [dispatch]); // Solo depende de dispatch

  // Opcional: Verifica los datos después de la carga
  useEffect(() => {
  }, [orders]); // Esto te mostrará los pedidos cada vez que `orders` cambie

  return (
    <ul>
      {orders.length > 0 ? (
        orders.map((order) => (
          <li key={order.id}>
            {order.productId} - {order.quantity}
          </li>
        ))
      ) : (
        <li>No orders available</li> // Mensaje en caso de que no haya pedidos
      )}
    </ul>
  );
};

export default OrderList;
